import React from 'react';

export default function About() {
  return (
    <div class="body">
      <div class="jumbotron">
        <div id="about-me-image">
          <img src="https://github.com/shannonjburris/react-portfolio/blob/main/public/Assets/Images/hero.png?raw=true" alt="me" />
        </div>
      </div>
      <hr class="my-4" />
      <div class="container">
        <p>Hello! My name is Shannon Burris. I am a web devloper with a background in music and education. I've created this portfolio to showcase my skills..</p>
      </div>
    </div>
  );
}
